        <Header />
        <div className="text-xl px-4 xl:text-5xl text-center md:mx-auto md:w-1/2 pt-20 xl:pt-48">
          <h1 className="font-bold">Hello, welcome to my Blog Page. I bet y'all gonna find out what I've built in this blog.</h1>
          <div className="text-base w-1/2 xl:w-1/3 md:text-2xl pt-10 mx-auto">
            You will see the react why you have to learn more from this.
          </div>
          <div className="justify-center pt-24 flex text-base xl:pt-20 xl:text-3xl">
            <a href="#" target="_blank" className="border-[1px] rounded-full hover:bg-primary px-4 py-1 xl:px-8 xl:py-2">See more</a>
          </div>
        </div>
        <div className="pl-4 pb-3">
          {/* <Footer /> */}
        </div>
      </div>
    );
  }

export default HomeWeb;
